import * as React from "react";
import { ImageTile as ImageTileProps } from "../model";
import "../style.css";
import { useRef, useEffect } from "react";

export default function ImageTile({
  elementKey,
  title,
  source,
}: ImageTileProps) {
  const imageRef = useRef(null);

  return (
    <img
      ref={imageRef}
      className="image"
      id={elementKey}
      src={source}
      alt={title}
    />
  );
}
